package com.github.bazukaa.nakshatra.portfolio.ui.main.projects;

import androidx.lifecycle.ViewModelProviders;

import android.os.Bundle;

import androidx.annotation.NonNull;
import androidx.annotation.Nullable;
import androidx.fragment.app.Fragment;
import androidx.recyclerview.widget.LinearLayoutManager;
import androidx.recyclerview.widget.RecyclerView;

import android.view.LayoutInflater;
import android.view.View;
import android.view.ViewGroup;

import com.github.bazukaa.nakshatra.portfolio.R;
import com.github.bazukaa.nakshatra.portfolio.ui.main.util.ImageSliderItem;
import com.github.bazukaa.nakshatra.portfolio.ui.main.projects.util.Project;
import com.github.bazukaa.nakshatra.portfolio.ui.main.projects.util.ProjectsAdapter;
import com.github.bazukaa.nakshatra.portfolio.viewmodel.ProjectsViewModel;

import java.util.ArrayList;
import java.util.List;

public class ProjectsFragment extends Fragment {

    private ProjectsViewModel mViewModel;

    private List<Project> mProjects = new ArrayList<>();

    public static ProjectsFragment newInstance() {
        return new ProjectsFragment();
    }

    @Override
    public View onCreateView(@NonNull LayoutInflater inflater, @Nullable ViewGroup container,
                             @Nullable Bundle savedInstanceState) {
        View view = inflater.inflate(R.layout.projects_fragment, container, false);

        //Projects recycler view
        populateProjectsList(mProjects);
        RecyclerView recyclerView = view.findViewById(R.id.frag_projects_rv_projects);
        ProjectsAdapter adapter = new ProjectsAdapter(getActivity(), mProjects);
        recyclerView.setAdapter(adapter);
        recyclerView.setLayoutManager(new LinearLayoutManager(getActivity()));

        return view;
    }

    @Override
    public void onActivityCreated(@Nullable Bundle savedInstanceState) {
        super.onActivityCreated(savedInstanceState);
        mViewModel = ViewModelProviders.of(this).get(ProjectsViewModel.class);
        // TODO: Use the ViewModel
    }

    private void populateProjectsList(List<Project> projects){
        List<ImageSliderItem> projectImage = new ArrayList<>();
        ImageSliderItem item1 = new ImageSliderItem("data:image/jpeg;base64,", "Goku");
        ImageSliderItem item2 = new ImageSliderItem("data:image/jpeg;base64,", "Chichi");
        ImageSliderItem item3 = new ImageSliderItem("data:image/jpeg;base64,", "Gohan");
        ImageSliderItem item4 = new ImageSliderItem("data:image/jpeg;base64,", "Goten");
        projectImage.add(item1);
        projectImage.add(item2);
        projectImage.add(item3);
        projectImage.add(item4);

        List<ImageSliderItem> projectImage2 = new ArrayList<>();
        ImageSliderItem item21 = new ImageSliderItem("data:image/jpeg;base64,", "Vegeta");
        ImageSliderItem item22 = new ImageSliderItem("data:image/png;base64,", "Bulma");
        ImageSliderItem item23 = new ImageSliderItem("data:image/jpeg;base64,", "Trunks");
        ImageSliderItem item24 = new ImageSliderItem("data:image/jpeg;base64,", "Bulla");
        projectImage2.add(item21);
        projectImage2.add(item22);
        projectImage2.add(item23);
        projectImage2.add(item24);
        Project project1 = new Project("Noted", projectImage, "noted description", "January 2020", "ongoing");
        Project project2 = new Project("Portfolio", projectImage2, "portfolio description", "February 2020", "ongoing");

        projects.add(project1);
        projects.add(project2);
    }



}
